import React, { Component } from 'react'

export default class Navigation extends Component {
    render() {
        return (
            <nav class="navbar fixed-top navbar-light bg-light">
                <a class="navbar-brand" href="#google.com">Fixed top</a>
            </nav>
        )
    }
}
